local ReplicatedStorage = game:GetService("ReplicatedStorage")
local Remote = ReplicatedStorage.Shared.Framework.Network.Remote

local RealFunction = Remote:WaitForChild("RemoteFunction")
local RealEvent = Remote:WaitForChild("RemoteEvent")

local FakeFunction = Instance.new("RemoteFunction")
FakeFunction.Name = "Function"
FakeFunction.Parent = Remote

local FakeEvent = Instance.new("RemoteEvent")
FakeEvent.Name = "Event"
FakeEvent.Parent = Remote

local mtFunc = getrawmetatable(FakeFunction)
local mtEvent = getrawmetatable(FakeEvent)

setreadonly(mtFunc, false)
setreadonly(mtEvent, false)

local oldIndexFunc = mtFunc.__index
mtFunc.__index = newcclosure(function(self, key)
    if key == "InvokeServer" then
        return function(_, ...)
            return RealFunction:InvokeServer(...)
        end
    end
    return oldIndexFunc(self, key)
end)

local oldIndexEvent = mtEvent.__index
mtEvent.__index = newcclosure(function(self, key)
    if key == "FireServer" then
        return function(_, ...)
            return RealEvent:FireServer(...)
        end
    end
    return oldIndexEvent(self, key)
end)

setreadonly(mtFunc, true)
setreadonly(mtEvent, true)

local mt = getrawmetatable(game)
setreadonly(mt, false)

local oldIndex = mt.__index
mt.__index = newcclosure(function(t, k)
    if t == Remote then
        if k == "Function" then return RealFunction end
        if k == "Event" then return RealEvent end
    end
    return oldIndex(t, k)
end)

setreadonly(mt, true)


